webpackJsonp([91807299555158],{855:function(t,e){t.exports={data:{wordpressPost:{title:"Rock stars, hypnotics and the Olympics: Most read articles in January",content:'<p>&nbsp;</p>\n<p>The most read article in January was Doyle <em>et al</em>&#8216;s recently published systematic review of the links between patient experience and clinical safety. Bellis <em>et al</em>&#8216;s <a href="http://news.discovery.com/human/solo-rock-stars-die-earlier-121220.htm">much</a> <a href="http://www.huffingtonpost.com/2012/12/20/rock-star-deaths-study-solo-acts-higher-risk_n_2338476.html">discussed</a> paper on rock star mortality was in second place, followed by Kripke <em>et al</em>&#8216;s study of hypnotics and mortality, originally published almost a year ago.</p>\n<p>Newly published papers in the top ten include Mahtani and colleagues&#8217; analysis of whether the London Olympics will increase participation in sport and Rowlingson <em>et al</em>&#8216;s mapping study of English GP prescribing data.</p>\n<p>&nbsp;</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Doyle <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001570.full">A systematic review of evidence on the links between patient experience and clinical safety and effectiveness</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Bellis <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/6/e002089.full">Dying to be famous: retrospective cohort study of rock and pop star mortality and its association with adverse childhood experiences</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Kripke <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/1/e000850.full">Hypnotics’ association with mortality or cancer: a matched cohort study</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Mahtani <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e002058.full">Can the London 2012 Olympics ‘inspire a generation’ to do more physical or sporting activities? An overview of systematic reviews</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Bergman <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/6/e001663.full">Vitamin D<sub>3</sub> supplementation in patients with frequent respiratory tract infections: a randomised and double-blind intervention study</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Ekpenyong <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/5/e001253.full">Urban city transportation mode and respiratory health effect of air pollution: a cross-sectional study among transit and non-transit workers in Nigeria</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Townsend and Pitchford</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/1/e000298.full">Baby knows best? The impact of weaning style on food preferences and body mass index in early childhood in a case–controlled sample</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Lee <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/1/2/e000269.long">UK stroke incidence, mortality and cardiovascular risk management 1999–2008: time-trend analysis from the General Practice Research Database</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Rowlingson <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001363.full">Mapping English GP prescribing data: a tool for monitoring health-service inequalities</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Rajavashisth <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/1/e000494.full">Decreased prevalence of diabetes in marijuana users: cross-sectional data from the National Health and Nutrition Examination Survey (NHANES) III</a></td>\n</tr>\n</tbody>\n</table>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"cc1bbbe8-0db9-5ac2-aec8-0764451cf34d"}}}});
